import React from 'react'
import {ButtonBase} from '@material-ui/core'
import {useStyles} from "./useStyle"

export const ButtonComponent = (props) => {
    const classes = useStyles();
    return (
        <ButtonBase className={classes.root} {...props}>
            {props.children}
        </ButtonBase>
    )
}
